import React from "react";
import image from "../../../../assets/images/decorator.svg";

const Decorator = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "end",
        alignItems: "end",
        width: "100%",
        marginTop: -100,
      }}
    >
      <img src={image} alt="" />
    </div>
  );
};

export default Decorator;
